    false,nt"url": null,nt"notes": "This narrative report for Rice Lake NWR
    outlines Refuge accomplishments from November, 1940 through January, 1941. The report
    begins by summarizing the weather conditions during this period. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
    and fish- is also covered. The Refuge development and maintenance section discusses
    physical developments. Resource management is outlined; topics include haying and
    timber removal. The public relations section of the report describes recreational
    uses and hunting.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
